import{_ as t,o as a,c as s,z as e,a as o}from"./chunks/framework.9482e208.js";const y=JSON.parse('{"title":"§ 1-7 Acts passed between certain dates not affected.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/1-7.md","filePath":"vacode/1-7.md"}'),n={name:"vacode/1-7.md"},r=e("h1",{id:"§-1-7-acts-passed-between-certain-dates-not-affected",tabindex:"-1"},[o("§ 1-7 Acts passed between certain dates not affected. "),e("a",{class:"header-anchor",href:"#§-1-7-acts-passed-between-certain-dates-not-affected","aria-label":'Permalink to "§ 1-7 Acts passed between certain dates not affected."'},"​")],-1),i=e("p",null,"The enactment of this Code shall not affect any act passed by the General Assembly, which shall have become a law after January 14, 1948, and before February 1, 1950; but every such act shall have full effect, and so far as the same varies from or conflicts with any provision contained in this Code it shall have effect as a subsequent act, and as repealing any part of this Code inconsistent therewith; provided, however, that any such act which becomes a law between said dates and which amends and reenacts, or reenacts any previously existing provisions of law conferring any power or imposing any duty upon any department, board, commission, agency or officer of the state government whose functions, powers and duties are affected by any of the provisions of this Code becoming effective July 1, 1948, shall be construed as conferring the powers and imposing the duties specified therein upon the department, board, commission, agency or officer of the state government to which or to whom the duties and powers imposed or conferred by such previously existing provisions of law were transferred by the provisions of this Code becoming effective July 1, 1948.",-1),c=e("p",null,"Code 1919, § 6568; R. P. 1948, § 1-7.",-1),d=[r,i,c];function f(h,l,p,m,u,b){return a(),s("div",null,d)}const v=t(n,[["render",f]]);export{y as __pageData,v as default};
